svg.desc:
#title: CsabaDu_DynamicTestData_TestData_Complete
	#direction: down
	#.contract: fill=#DCE8CF title=center,italic,bold body=left,italic
	#.abstract: fill=#C9DEEF title=center,italic,bold body=left,italic
	#.group: title=center,bold body=left dashed
	#.concrete: fill=#C9DEEF title=center,bold body=left

	[<contract>INamedTestCase
	extends: IEquatable<INamedTestCase>
	|
	  TestCaseName: string;
	  |
	  ContainedBy(IEnumerable<INamedTestCase>?): bool;
	  GetDisplayName(string?): string?;
	]

	[<contract> ITestData
	|
	  GetDefinition(): string;
	  GetResult(): string;
	  ToParams(ArgsCode): object?array;
	  ToParams(ArgsCode, PropsCode): object?array;
	]

	[<abstract>NamedTestCase
	|
	  TestCaseName: abstract string;
	  |
	  ContainedBy(IEnumerable<INamedTestCase>?): bool;
	  GetDisplayName(string?): string?;
	  Equals(INamedTestCase?): bool;
	  Equals(object?): override sealed bool;
	  GetHashCode(): override sealed int;
	  ToString(): override sealed string;
	  ||
	  Comparer: static IEqualityComparer<INamedTestCase>
	  |
	  CreateDisplayName(string?, params object?array): static string?;
	]

	[<abstract>TestDataBase
	|
	  TestDataBase(string);
	  |
	  TestCaseName: override sealed string;
	  |
	  GetDefinition(): string;
	  ToParams(ArgsCode): object?array;
	  ToParams(ArgsCode, PropsCode): virtual object?array;
	  GetResult(): abstract string;
	]

	[<abstract>TestData
	|
	  TestData(string, string
	  |
	  GetResult(): override sealed string;
	  ToParams(ArgsCode, PropsCode): override sealed object?array;  
	]

	[<concrete>TestData<T1>
	|
	  TestData(string, string, T1?)
	  |
	  Arg1: T1?
	]

	[<concrete>TestData<T1, T2>
	|
	  TestData(string, string, T1?, T2?)
	  |
	  Arg2: T2?
	]

	[<concrete>TestData<T1, T2, ..., T9>
	|
	  TestData(string, string, T1?, T2? ..., T9?)
	  |
	  Arg9: T9?
	]

	[<abstract>TestDataReturns<TStruct> 
	|
	  TestDataReturns(string, TStruct)
	  |
	  ResultPrefix: override sealed string;
	  |
	  GetResult(): override sealed string;
	  ToParams(ArgsCode, PropsCode): override sealed object?array;
	]


	[<abstract>TestDataThrows<TException>
	|
	  TestDataThrows(string, TException)
	  |
	  ResultPrefix: override sealed string;
	  |
	  GetResult(): override sealed string;
	  ToParams(ArgsCode, PropsCode): override sealed object?array;
	]

	[<abstract>TestDataExpected<TResult>
	|
	  TestDataExpected(string, TResult)
	 |
	 Expected: TResult;
	 ResultPrefix: abstract string;
	 |
	 GetExpected(): object;
	 ToParams(ArgsCode, PropsCode): override object?array
	 ]

	[<contract> IExpected
	|
	  ResultPrefix: string;
	  |
	  GetExpected(): object;
	]

	[<contract> IReturns]


	[<contract> IExpected<out TResult>
	where TResult: notnull
	|
	  Expected: TResult
	]

	[<contract>IThrows
	]

	[<contract> IReturns<out TStruct>
	where TStruct: struct
	]

	[<contract> IThrows<out TException>
	where TException: Exception
	]


	[<concrete>TestDataReturns<TStruct, T1> 
	|
	  TestDataReturns(string, TStruct, T1?)
	  |
	  Arg1: T1?
	]

	[<concrete>TestDataThrows<TException, T1>
	|
	  TestDataThrows(string, TException, T1?)
	  |
	  Arg1: T1?
	]

	[<concrete>TestDataReturns<TStruct, T1, T2> 
	|
	  TestDataReturns(string, TStruct, T1?, T2?)
	  |
	  Arg2: T2?
	]

	[<concrete>TestDataThrows<TException, T1, T2>
	|
	  TestDataThrows(string, TException, T1?, T2?)
	  |
	  Arg2: T2?
	]

	[<concrete>TestDataReturns<TStruct, T1, T2, ..., T9> 
	|
	  TestDataReturns(string, TStruct, T1?, T2?, ..., T9?)
	  |
	  Arg9: T9?
	]

	[<concrete>TestDataThrows<TException, T1, T2, ..., T9>
	|
	  TestDataThrows(string, TException, T1?, T2?, ..., T9?)
	  |
	  Arg9: T9?
	]


	// diagram


	[
	TestData<T1, T2, ..., T9>
	] -:> [
	TestData<T1, T2>
	]


	[
	TestData<T1, T2>
	] -:> [
	TestData<T1>
	]

	[
	TestData<T1>
	] -:> [
	TestData
	]

	[
	TestData
	] -:> [
	TestDataBase
	]

	[
	INamedTestCase
	] <:-- [
	NamedTestCase
	]

	[
	INamedTestCase
	] <:- [
	ITestData
	]

	[
	ITestData
	] <:-- [
	TestDataBase
	]

	[
	NamedTestCase
	] <:- [
	TestDataBase
	]

	[
	TestDataBase
	] <:- [
	TestDataExpected<TResult>
	]

	[
	TestDataExpected<TResult>
	] <:- [
	TestDataReturns<TStruct>
	]

	[
	TestDataExpected<TResult>
	] --:> [
	IExpected<out TResult>
	]



	[
	TestDataExpected<TResult>
	] <:- [
	TestDataThrows<TException>
	]

	[
	TestDataReturns<TStruct>
	] <:- [
	TestDataReturns<TStruct, T1>
	]

	[
	TestDataReturns<TStruct>
	] --:> [
	IReturns<out TStruct>
	]

	[
	IExpected<out TResult>
	] <:- [
	IReturns<out TStruct>
	]

	[
	IExpected<out TResult>
	] -:> [
	IExpected
	]

	[
	IExpected<out TResult>
	] <:- [
	IThrows<out TException>
	]

	[
	TestDataThrows<TException>
	] --:> [
	IThrows<out TException>
	]

	[
	TestDataThrows<TException>
	] <:- [
	TestDataThrows<TException, T1>
	]

	[
	TestDataReturns<TStruct, T1>
	] <:- [
	TestDataReturns<TStruct, T1, T2>
	]

	[
	IReturns<out TStruct>
	] -:> [
	IReturns
	]

	[
	IReturns
	] -:> [
	IExpected
	]

	[
	IThrows
	] -:> [
	IExpected
	]

	[
	IThrows<out TException>
	] -:> [
	IThrows
	]

	[
	TestDataThrows<TException, T1>
	] <:- [
	TestDataThrows<TException, T1, T2>
	]

	[
	TestDataReturns<TStruct, T1, T2>
	] <:- [
	TestDataReturns<TStruct, T1, T2, ..., T9>
	]

	[
	TestDataThrows<TException, T1, T2>
	] <:- [
	TestDataThrows<TException, T1, T2, ..., T9>
	]
